import axios from "axios";
import React, { useEffect, useState } from "react";
import images from "../../assets";
import Footer from "../../components/footer";
import SearchBar from "../../components/searchBar";
import { rentOptions, saleOptions } from "../../utiles/fetchApi";
import BannerSections from "./bannerSections";
import constants from "./constants";
import PropertySection from "./sections";
import { HeaderContainer, Logo, PropertySectionINNERContainer } from "./styles";

export default function Home() {
  // const [propertyName, setPropertyName] = useState();
  // const [propertyCoverPhoto, setPropertyCoverPhoto] = useState();
  // const [baths, setBaths] = useState();
  // const [rooms, setRooms] = useState();
  // const [price, setPrice] = useState();

  const [rentPropertyName, setRentPropertyName] = useState();
  const [rentPropertyCoverPhoto, setRentPropertyCoverPhoto] = useState();
  const [rentBaths, setRentBaths] = useState();
  const [rentrooms, setRentRooms] = useState();
  const [rentPrice, setRentPrice] = useState();

  const [propertyArray, setPropertyArray] = useState([
    { title: "default 1", baths: "NA", rooms: "NA", price: "NA", image: "NA" },
    { title: "default 2", baths: "NA", rooms: "NA", price: "NA", image: "NA" },
    { title: "default 3", baths: "NA", rooms: "NA", price: "NA", image: "NA" },
  ]);

  useEffect(() => {
    getData();
  }, []);

  const getData = () => {
    axios
      .request(saleOptions)
      .then(function (response) {
        console.log(response.data);

        setPropertyArray([
          {
            title: response.data.hits[0].title,
            image: response.data.hits[0].coverPhoto.url,
            baths: response.data.hits[0].baths,
            rooms: response.data.hits[0].rooms,
            price: response.data.hits[0].price,
          },
          {
            title: response.data.hits[1].title,
            image: response.data.hits[1].coverPhoto.url,
            baths: response.data.hits[1].baths,
            rooms: response.data.hits[1].rooms,
            price: response.data.hits[1].price,
          },
          {
            title: response.data.hits[0].title,
            image: response.data.hits[0].coverPhoto.url,
            baths: response.data.hits[0].baths,
            rooms: response.data.hits[0].rooms,
            price: response.data.hits[0].price,
          },
        ]);
      })
      .catch(function (error) {
        console.error(error);
      });

    axios
      .request(rentOptions)
      .then(function (response) {
        console.log(response.data);
        setRentPropertyName(response.data.hits[0].title);
        setRentPropertyCoverPhoto(response.data.hits[0].coverPhoto.url);
        setRentBaths(response.data.hits[0].baths);
        setRentRooms(response.data.hits[0].rooms);
        setRentPrice(response.data.hits[0].price);
      })
      .catch(function (error) {
        console.error(error);
      });
  };

  // useEffect(() => {
  //   axios
  //     .request(saleOptions)
  //     .then(function (response) {
  //       console.log(response.data);

  //       setPropertyArray([]);

  //       setPropertyName(response.data.hits.title);
  //       setPropertyCoverPhoto(response.data.hits.coverPhoto.url);
  //       setBaths(response.data.hits.baths);
  //       setRooms(response.data.hits.rooms);
  //       setPrice(response.data.hits.price);
  //     })
  //     .catch(function (error) {
  //       console.error(error);
  //     });

  //   axios
  //     .request(rentOptions)
  //     .then(function (response) {
  //       console.log(response.data);
  //       setRentPropertyName(response.data.hits[0].title);
  //       setRentPropertyCoverPhoto(response.data.hits[0].coverPhoto.url);
  //       setRentBaths(response.data.hits[0].baths);
  //       setRentRooms(response.data.hits[0].rooms);
  //       setRentPrice(response.data.hits[0].price);
  //     })
  //     .catch(function (error) {
  //       console.error(error);
  //     });
  // }, []);

  return (
    <>
      <HeaderContainer>
        <Logo src={images.houseLogo}></Logo>
      </HeaderContainer>
      <SearchBar />
      <BannerSections
        image={images.rentBanner}
        description={constants.rentProperty.description}
        title={constants.rentProperty.title}
        button={constants.rentProperty.button}
      ></BannerSections>
      <PropertySection
        title={rentPropertyName}
        baths={rentBaths}
        rooms={rentrooms}
        price={rentPrice}
        image={rentPropertyCoverPhoto}
      ></PropertySection>

      <BannerSections
        image={images.buyBanner}
        description={constants.buyProperty.description}
        title={constants.buyProperty.title}
        button={constants.buyProperty.button}
      ></BannerSections>

      <PropertySectionINNERContainer>
        {propertyArray.map((array) => {
          return (
            <PropertySection
              title={array.title}
              baths={array.baths}
              rooms={array.rooms}
              price={array.price}
              image={array.image}
            ></PropertySection>
          );
        })}
      </PropertySectionINNERContainer>
      <Footer title={"2022 Homestead"}></Footer>
    </>
  );
}
